import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import state, { addPost, sendMessage, updateNewPostText, updateNewMessageText, subscribe} from './redux/state'


let rerender = (state) => {
  ReactDOM.render(
    <React.StrictMode>
      <App data={state}
           addPost={addPost}
           sendMessage={sendMessage}
           updateNewPostText={updateNewPostText}
           updateNewMessageText={updateNewMessageText}

      />
    </React.StrictMode>,
    document.getElementById('root')
  );
}



rerender(state);
